import './App.css';
import Header from './Components/Header';


const App = () => {
    return (
      <div className='app-wrapper'>
          < Header />

          <nav className='nav'>
            <div>
              <a>Profile Messages</a>
            </div>
            <div>
              <a>Messages</a>
            </div>
            <div>
              <a>News</a>
            </div>
            <div>
              <a>Music</a>
            </div>
            <div>
              <a>Settings</a>
            </div>
          </nav>
          < Conte />

      </div>
    );
  }

export default App;
